CREATE DATABASE ATMDATABASE;

USE ATMDATABASE;


create table CustomerTable (
	id INT,
	First_name VARCHAR(50),
	Last_name VARCHAR(50),
	UserName VARCHAR(50),
	Gender VARCHAR(50),
	Card_No VARCHAR(50),
	Balance INT,
	Pin_No INT,
	Phone_Number VARCHAR(50)
);



create table BankAdminTable (
	id INT,
	First_name VARCHAR(50),
	Last_name VARCHAR(50),
	Gender VARCHAR(50),
	PinCode INT,
	Phone_Number VARCHAR(50),
);
